std::ostream& operator<<(std::ostream& os, FetchHandlerExistence value) {
  switch(value) {
    case FetchHandlerExistence::UNKNOWN:
      return os << "FetchHandlerExistence::UNKNOWN";
    case FetchHandlerExistence::EXISTS:
      return os << "FetchHandlerExistence::EXISTS";
    case FetchHandlerExistence::DOES_NOT_EXIST:
      return os << "FetchHandlerExistence::DOES_NOT_EXIST";
    default:
      return os << "Unknown FetchHandlerExistence value: " << static_cast<int32_t>(value);
  }
}

